INSERT INTO `db_platform` VALUES (1, 'Family Computer', 'FC', '红白机', '1983-07-15', '任天堂', '任天堂', NULL, NULL, '红白机是任天堂生产的8位家用游戏机。游戏机于1983年7月15日在日本以“Family Computer”（ファミリーコンピュータ，简称“Famicom”或“FC”）为名推出，1985年起在欧美以“Nintendo Entertainment System”（简称“NES”）为名发行。\r\n红白机是当时最畅销的游戏机，全球累计销量超过了6100万台。红白机出现对电子游戏产生了十分深远的影响，让美国电子游戏界从1983年的崩溃中恢复过来，也奠定了任天堂在当今游戏界的地位。游戏机的后续机种为1990年推出的超级任天堂。\r\n1981年，应当时任天堂社长山内溥的开发要求——比竞争对手便宜，但是一年内不能被竞争对手超越，由上村雅芝领头，开发代号“GameCom”的基于卡带的游戏机研发计划正式启动。\r\n1983年7月15日，FC在日本正式发售，初期因硬件缺陷而大规模回收，导致其人气飙升，并且在次年年底成为日本最畅销的游戏机。同时，1984年任天堂创建的权利金制度，不仅使软件质量得到了保证，还为任天堂创造了巨大的利润。\r\n2003年7月15日，正值FC二十周年之际，任天堂宣布9月25日FC游戏机正式停产。2007年11月，任天堂宣布这款已有24年历史的红白机不再维修，正式终结了这部陪伴不少机迷成长的旧世代游戏机的时代。', NULL, NULL, NULL, NULL, '2023-01-17 14:29:38', '2023-01-17 14:33:21');
